import React, {useEffect,useState} from 'react'

import ItemList from './ItemList'
import {useParams} from 'react-router-dom'

const test =[
  {id:1, price: 250,category:"exterior",titulo:"mesa", image:"data:image/jpeg;base64,"},
  {id:2, price: 50,category:"interior", titulo:"jarron", image:"data:image/jpeg;base64,"},
  {id:3, price: 500,category:"interior",titulo:"ropero", image:"data:image/jpeg;base64,"},
  {id:4, price: 100,category:"exterior",titulo:"silla", image:"data:image/jpeg;base64,"},

];




export default function ItemListContainer({greeting}) {
    const [data,setData] = useState([]);

    const {categoriaId} = useParams();
    
    useEffect(()=>{
      const getData = new Promise(resolve =>{
        setTimeout(()=>{
          resolve(test);
        },1000)
      });
if(categoriaId){
      getData.then(res => setData(res.filter(test => test.category === categoriaId)));
    }else
      getData.then(res => setData(res));

    },[categoriaId])


  return (<>
    <div>{greeting},

 
    </div>,
  
  <ItemList data={data}/>

  </>
  )
}
